import React from 'react';
import styled from 'styled-components';

const HeaderContainer = styled.header`
  position: relative;
  display: flex;
  justify-content: space-between;
  align-items: center;
  min-width: 320px;
`;

const LogoThumb = styled.div`
  padding-top: 24px;
  padding-left: 20px;
`;

const HeaderLinkArea = styled.a`
  padding: 15px 0;
`;

const Vector = styled.div`
  position: absolute;
  width: 1500px;
  height: 0px;
  left: 300px;
  top: 105px;
  border: 2px solid #E4E2DD;
  transform: rotate(0.01deg);
`;

const Header = () => {
  return (
    <HeaderContainer>
      <LogoThumb>
        <HeaderLinkArea href="./index.html">
          <img className="header__logo" src="./img/logo-tabaco.svg" alt="Логотип компанії" />
        </HeaderLinkArea>
      </LogoThumb>
      <div className="menu" data-menu>
        <div className="container menu__container">
          <nav className="nav">
            <ul className="site-nav list">
              <li className="site-nav__item">
                <a className="site-nav__link link site-nav__link--current" href="./index.html">Головна</a>
              </li>
              <li className="site-nav__item">
                <a className="site-nav__link link" href="./goods.html">Товари</a>
              </li>
            </ul>
            <div className="vector" src="" alt=""></div>
          </nav>
        </div>
      </div>
    </HeaderContainer>
  );
};

export default Header;
